import React from 'react';
import './App.css'; // 스타일을 위한 CSS 파일

function App() {
  return (
    <div className="container">
      <h1>캐-안습</h1>
      <p>: 해체의 음향을 컴퓨터 사용 속의 교정을 위한 논거? 보호 프로그램</p>
      <ul>
        <li>낮은 양적인 파악은 위해서 교정을 하용하자마자.</li>
        <li>경고를 전달하기 위해서 서기 교정을 하용하자마자.</li>
      </ul>
      <div className="cards">
        <Card title="카메라 권한" description="낮은 카메라를 활성화 알아서 하세요." />
        <Card title="포토 앨범에사진" description="카메라를 잘사요 사용하다로 앨범에 애니메이션을 넣는다." />
        <Card title="자동 바깥 조절" description="어떻게 활성화에 카메라를 할까요? 자바스크립트 안에 자동으로 바깥을 조절하다." />
      </div>
    </div>
  );
}

function Card({ title, description }) {
  return (
    <div className="card">
      <h2>{title}</h2>
      <p>{description}</p>
      <ToggleSwitch />
    </div>
  );
}

function ToggleSwitch() {
  return <div className="toggle-switch"></div>;
}

export default App;
